(28, 'Flights to Paris', '', 'Experience an amazing flying experience to Paris with Bookofares. Get amazing discounts on wide range of flights to Paris. Avail the latest updates on flight departure, seating preference and meal. We are dedicated when it comes to providing the best flight experience to Paris. \n<br/><br/>\nChoose from top flights and experience a hassle-free ticket booking. Explore the best of Paris the fashion capital of the world. Our aim is to always provide the quickest and easy flight booking online services to our users.', '0', '', '0', '2018-02-22 13:00:34', 'Enabled', '0000-00-00 00:00:00', 'True', '2018-04-14 12:51:45'),
(29, 'Flights to London', '', 'lowflyfares lends you the best searching tool to get the best deals on flights to London.  Search for top-flight deals along with your preferred departure. The website makes searching a lot easy with flights of your choice. To get the best results just fill in the brackets with your desired choices like the timing of the flight and date. \r\n\r\nWe pay utmost attention to making the website user-friendly. The website gives you the largest number of search results for flights to London. You can further refine yoursearch according to your needs and can get you the huge bargains on flights to London.', '0', '0', '', '2018-02-22 13:01:48', 'Enabled', '2018-04-14 12:54:57', 'False', '0000-00-00 00:00:00'),
(27, 'Flights to Manila', '', 'Book non-stop flights to Manila and experience a hassle-free journey to the destination.  At Bookofares users will be getting great discounts on fares to Manila. We constantly update all the cheapest airfares so that our users can have the best fares at their disposable. \n<br/><br/>\nManila the famed city is full of amazing surprises and tourist attractions. To visit the grand city we offer all the vital information regarding the flight details. We believe in making your travel a memorable journey. Travellers while booking a ticket have the option to filter and find the best deals on flights to Dubai.', '0', '', '0', '2018-02-22 12:59:41', 'Enabled', '0000-00-00 00:00:00', 'True', '2018-04-14 12:51:11'),
(26, 'Flights to Bangkok', '', 'At Bookofares choose from a wide range of budget flights to Bangkok. We assist travellers looking out for the best flight deals to Bangkok. Our user-friendly interface lets travellers get their choice of deals on any flights to Bangkok. \n<br/><br/>\nWe are experts in providing convenient departure to the travellers. Users can filter their booking requirements. While booking the flight users also have the preferences of seat, dinner or departure timing. At Bookofares we are highly committed providing cheap air tickets of your choice, without making a dent in your pocket.', '0', '', '0', '2018-02-22 12:58:46', 'Enabled', '0000-00-00 00:00:00', 'True', '2018-04-14 12:51:26'),
(24, 'International Destinations', '', '', '0', '', '0', '2018-02-22 12:57:46', 'Enabled', '0000-00-00 00:00:00', 'True', '2018-04-14 12:51:59'),
