(23, 'Flights to Denver', '', 'Experience hassle-free flight ticket booking to Denver and enjoy your flight like never before. Get the best deals on top flights to Denver. Bookofares focuses on providing the best discounts on a range of flights from economy to premium. Visit our page to experience a user-friendly interface, which helps in making your search easy.\n<br/><br/>\nAlso, our simple and superior search engine lets you find even the tiniest details you want to know such as flight departure timing, airfare, meal and lot more. At Bookofares we are highly committed to providing the cheap plan seat of your choice, without making a dent in your pocket.', '0', '', '0', '2018-02-22 12:21:21', 'Enabled', '0000-00-00 00:00:00', 'True', '2018-04-14 12:51:54'),
(22, 'Flights to California', '', 'Bookofares gives you the best deal to find the cheapest and most affordable flights to California. Visit our page to browse nonstop flights and hassle-free departure everysingle day of the year. Search conveniently and book the best California flight.\n<br/><br/>\nWith us, you are always just a click away finding your desired flight according to your schedule.\n<br/><br/>\nUsing our search engine is a cake walk  a user just need to type his/her respective requirements and we will come up with the best results. If you are flexible with time, and dates, a user will find even better flight bargain to California.', '0', '', '0', '2018-02-22 12:19:17', 'Enabled', '0000-00-00 00:00:00', 'True', '2018-04-14 12:50:56'),
(21, 'Flights to New York', '', 'Get the best deals on Flights to New York with lowflyfares advanced search engine. The website gives you heavy discounts on a range of flights to New York. Make your travel hassle-free with your choice of flights and departure. \r\n\r\nIt doesnt matter whether you are going for a business meet or family get together we are here to provide you with the best travel itinerary. Here you can find the best airline operating within the domestic arena. Choose the flight which suites you the best if you are flexible with the time. ', '0', '0', '', '2018-02-22 12:17:40', 'Enabled', '2018-04-14 12:56:32', 'False', '0000-00-00 00:00:00'),
