(19, 'Flights to Orlando', '', 'lowflyfares gives you the best deal to find the cheapest and most affordable flights to Orlando. Visit our page to browse nonstop flights and hassle-free departure every single day of the year. Search at your convenient and book the best Orlando flight. With us, you are always just a click away finding your desired flight according to your schedule.\r\n\r\nUsing our search engine is a cake walk  a user just need to type his/her respective requirements and we will come up with the best results. If you are flexible with time and dates, a user will find even better flight bargain to Orlando.', '0', '0', '', '2018-02-22 12:12:21', 'Enabled', '2018-04-14 12:57:26', 'False', '0000-00-00 00:00:00'),
(18, 'Hotels', '', 'At Bookofares experience quick and hassle-free online hotel booking, just a click away. We strive to give you the best deal on a range of hotel booking both in America and across the world. We meet your all stay requirements, whether you are looking for a brief stay, booking a holiday resort, or business suite both in the domestic circuit and anywhere in the world. \n<br/><br/>\nWe have the option to compare rates from a range of hotels, ranging from executive suites to premium five-star hotels guaranteeing you to find the best deal available. Also, when you are searching for the perfect hotel at Bookofares, our extensive search will lend you the best results.', '0', '', '0', '2018-02-22 12:09:59', 'Enabled', '0000-00-00 00:00:00', 'True', '2018-04-14 12:49:53'),
(17, 'Flights', '', 'Find the best rates for a range of flights to the destination of your choice. Bookofares.com lets you find multiple options for domestic and  international flights. Whether you choose to avail our self-service internet booking engine or if you wish to book your travel through our travel expert professionals, BookOfares.com will help you to find great discounts even on premium flights for domestic or international destinations. The fares we offer are really great fares which are deeply discounted.<br/><br/>\nWe take pride in specializing and giving you the best results when booking for the last minute flight. Fly high and cheap while experiencing the convenient online flight booking.', '0', '', '0', '2018-02-22 12:07:18', 'Enabled', '0000-00-00 00:00:00', 'True', '2018-04-14 12:49:43'),
(16, 'About Us', '', 'lowflyfares is a leading online travel agency offering affordable flight booking for domestic and international flights. The company stresses on providing quick and convenient travel booking assistance to all its users. Our website\'s user-friendly interface and filters give you the perfect results regarding the seating and meal option, also book now flight and pay later option. \r\n\r\nUsers can always find and book cheap flights upfront on the website, without even filtering too much. No matter whether it is a domestic or international flight we have the best and affordable ticket booking option always at your disposable. ', '0', '0', '', '2018-02-22 12:06:36', 'Enabled', '2018-04-14 12:58:04', 'False', '0000-00-00 00:00:00');
