(111, '271', 'On board services of United Airlines:', '1 . Snake with  your choice of beverages (included cookies, pretzels or a snack mix)\r\n<br>\r\n2 . Main Course included (Smoked Chicken, Seared Sweet chili chicken served)\r\n<br>\r\n3 . Premium dessert (ice cream, sorbet)\r\n\r\n', '0', '0', '', '2018-11-06 12:11:52', 'Enabled', '2018-12-31 16:36:44', 'False', '0000-00-00 00:00:00'),
(113, '273', 'The Best Time to visit in New York ', 'The excellent time to go to new york city is from April to June and September to early November when the weather is warm and great.', '0', '0', '', '2018-12-20 16:17:53', 'Enabled', '2018-12-29 19:52:34', 'False', '0000-00-00 00:00:00'),
(114, '274', 'The best place to visit', 'The best place to visit the San Francisco is Bay Area Discovery Museum: Yes you have visited the Golden Gate Bridge to get this Children Museum where a large and excessive amount of indoor and outdoor games you can experiences with your child at the age of 6  12 years old. This area is covered by 2.5-acre land there are so many exposures like a tide pool, gravel pits, spider web installation etc.\r\n', '0', '0', '', '2018-12-21 13:50:16', 'Enabled', '2018-12-29 16:45:56', 'False', '0000-00-00 00:00:00'),
(115, '275', 'The best place to visit New York:', 'Times Square: Time Square is the center of attraction place on New York the entertaining street, billboard, and advertisement. It is the most visited place by a visitor. Over the 3,30,000 people daily across the time square place.  \r\n', '0', '0', '', '2018-12-21 13:54:46', 'Enabled', '2018-12-27 19:05:44', 'False', '0000-00-00 00:00:00'),
(116, '276', 'Best place for sightseeing in Los Angeles:', 'Santa Monica: this place is a natural magnet for tourists and alike local people too. It is famous for a beautiful and elegant vision of the beach, the shops, restaurants, and exotic food.\r\n', '0', '0', '', '2018-12-21 13:58:41', 'Enabled', '2018-12-29 16:55:37', 'False', '0000-00-00 00:00:00'),
(117, '277', 'Best Time To Visit In New York:', 'From April to June and September to early November the weather is warm and pleasant, it May to October through July and August there will be hot and humid, for honeymoon May, June, September, and October is the best time spend there.', '0', '0', '', '2018-12-21 14:06:58', 'Enabled', '2018-12-29 20:06:43', 'False', '0000-00-00 00:00:00'),
(118, '278', 'The best place to visit in Chicago :', 'The Rookery Building: this is the most historically significant building in Chicago. This architecture of this building is astounding design and the ornamental ironwork on the staircase is the icing on the cake.\r\n', '0', '0', '', '2018-12-21 14:12:10', 'Enabled', '2018-12-27 16:51:56', 'False', '0000-00-00 00:00:00'),
(119, '279', 'Best place in Houston :', 'The Children\'s Museum of Houston ;<br>\r\nThis museum is known for the creativity, fun, colorful, and filled with energy. If you are traveling with your kids then you must visit this place squeeze full of fun, hand exhibits of science and technology, human development, history, and culture there is an abundance of opportunity to explore your world.', '0', '0', '', '2018-12-21 14:20:53', 'Enabled', '2018-12-28 18:31:11', 'False', '0000-00-00 00:00:00'),
(120, '280', 'The best place to visit in Chicago:', 'This aquarium is the first inland aquarium with a permanent briny fish collection. This location is situated in a Lake Michigan. In this aquarium, there are 1,500 species including fishes, marine mammal, bird, snakes, insects, and amphibians.', '0', '0', '', '2018-12-21 14:24:13', 'Enabled', '2018-12-29 16:34:09', 'False', '0000-00-00 00:00:00'),
(121, '281', 'In-Fight Services', 'Being a leading airline it offers number of services for free to make the traveler experience much better.<br/>Access to a large number of TV shows and channels <br/>\r\n\r\nFree informing <br/>\r\n\r\nFree WI-FI for everybody<br/>\r\n\r\nFascinating sustenance from very propelled gourmet experts <br/>\r\n\r\nExceptional and agreeable seat <br/>\r\n\r\n\r\n\r\nGet exceptional dinner like eating regimen unique or alter <br/>\r\n\r\nAlongside these administrations you get some more administration which relies upon your booking class and goals<br/>', '0', '0', '', '2018-12-22 16:51:51', 'Enabled', '2018-12-31 16:29:52', 'False', '0000-00-00 00:00:00'),
(122, '282', 'Flying Experience', 'American Airline offers number of services free for its customers </br>\r\nFree TV & Music</br>\r\nFree Wi-Fi </br>\r\nFree Gaming Console </br>\r\nOnboard charging of Mobile Phones & laptops</br>', '0', '0', '', '2018-12-22 16:58:25', 'Enabled', '2018-12-31 16:41:45', 'False', '0000-00-00 00:00:00'),
(123, '283', 'In-Fight Services', 'Traveler can order special meals for diabetics, vegetarians, religious can be ordered up to 24 hours before the scheduled departure at no extra cost. It also offers Religious Meals, Child Meal & Vegetarian Meal.\r\nIt offers both way of check-in like Online Check-In & Airport Check-In.\r\nIn addition to this , Lufthansa Inflight Entertainment consist of free movies & music while flying.\r\n', '0', '0', '', '2018-12-22 17:01:36', 'Enabled', '2018-12-31 16:47:02', 'False', '0000-00-00 00:00:00'),
(124, '284', 'Services', 'Built up in 1927, British Airways is one of the famous aircrafts known for its uncommon administrations. Flying with British Airways enable you to spare money on movement costs, as it offers modest flight tickets all during that time alongside alluring limits on ticket appointments. On the off chance that we talk about the administrations and courtesies offered, it is an ideal equivalent word of significant worth for cash. Be that as it may, it differs, contingent upon the class you are going with.It offers number of option in class to choose from.', '0', '0', '', '2018-12-22 17:03:57', 'Enabled', '2018-12-31 16:53:41', 'False', '0000-00-00 00:00:00'),
(125, '285', 'The Best Place To Visit In San Francisco:<br><br>Asian Art Museum:', 'The Asian Art Museum is undeniably one of the most cardinal museums in San Francisco. This museum has a collection of 18,000 work of Art, Museum has an immeasurable collection of art, sculpture, painting, jade carving, a ceramic and architectural fragment from Iran, India, China, Japan, and other Asian Culture.', '0', '0', '', '2018-12-22 17:11:30', 'Enabled', '2018-12-31 17:46:08', 'False', '0000-00-00 00:00:00'),
(126, '286', 'Best Time to Visit', 'To experience the real beauty of phoenix &  to make your travel experience a memorable one visit this awesome place from November to April.', '0', '0', '', '2018-12-22 17:15:04', 'Enabled', '2018-12-31 17:51:40', 'False', '0000-00-00 00:00:00'),
(127, '287', 'Best Time to Visit Houston:', 'There is a lot to do in Houston but the matter is that at what time is best to explore. Winter, as well as spring, are the best time to visit the Houston. With the mild wind and lupin blooms.', '0', '0', '', '2018-12-22 17:17:33', 'Enabled', '2019-01-03 13:18:17', 'False', '0000-00-00 00:00:00'),
(128, '288', 'Best Time to visit', 'Best time to experience real fun of travel is the spring season , which commence from March and last till May.You can also visit this amazing city during September till  November.', '0', '0', '', '2018-12-22 17:21:25', 'Enabled', '2018-12-31 18:05:36', 'False', '0000-00-00 00:00:00'),
(129, '289', 'Best Time to visit ', 'October to April is a nice time for book tickets to Miami. maximum travelers choose to travel to Miami during this period due to the fact eating places and motels offer huge discounts, and additionally, the smaller crowds will appeal to a few visitors. Miami has tropical weather, having hot summers and short warm wintry weather durations. one of the superb things to do in Miami is leased a yacht and get revel in cruising throughout the Atlantic Ocean. There also are plenty of wonderful attractions throughout the Port of Miami.', '0', '0', '', '2018-12-22 17:51:10', 'Enabled', '2019-01-02 18:31:47', 'False', '0000-00-00 00:00:00'),
(130, '290', 'Best Time To Visit The Orlando:', 'Weather of Orlando suitable for a tour during the winter month through spring. While in other countries there were cold,  Orlando has a warmed and dry. In Orlando, in the season of spring, the place is full of tourists.', '0', '0', '', '2018-12-22 17:56:34', 'Enabled', '2019-01-02 18:19:59', 'False', '0000-00-00 00:00:00'),
(131, '291', 'Best Time to visit', 'this city has a  Mediterranean, so in the summers can grow very hot,south as one approaches the Sahara.<br>\r\nIn the Winters in the north will be quite bitter.<br>\r\nthe  best times to visit are in the spring,from April to June, blooming poppies and the apricot season is at its height, and also in September and October it is a mild temperature to visit Tunisia.', '0', '0', '', '2018-12-22 17:59:16', 'Enabled', '2019-01-03 12:03:45', 'False', '0000-00-00 00:00:00'),
(132, '292', 'Best Time To Visit In Minneapolis :', 'This place has a warm and humid summer. Late spring (March-May) when the temperature is mild as well as in winter (December- February) this place have a crowd.', '0', '0', '', '2018-12-22 18:02:01', 'Enabled', '2018-12-31 19:41:49', 'False', '0000-00-00 00:00:00'),
(133, '293', 'Best Time To Visit In Detroit:', 'We suggest you travel in early summer and spring is also busiest time with the less wind and more rainfall. Blooming of flowers grow little later to Detroit, but once flower show up then the city looks the pretty place to visit.', '0', '0', '', '2018-12-22 18:07:38', 'Enabled', '2019-01-16 18:25:47', 'False', '0000-00-00 00:00:00'),
(134, '294', 'The best place to visit in Chicago :', 'The Rookery Building: this is the most historically significant building in Chicago. This architecture of this building is astounding design and the ornamental ironwork on the staircase is the icing on the cake.\r\n', '0', '', '', '2018-12-27 17:01:28', 'Enabled', '0000-00-00 00:00:00', 'False', '0000-00-00 00:00:00'),
(135, '295', 'The best place to visit New York:', 'Times Square: Time Square is the center of attraction place on New York the entertaining street, billboard, and advertisement. It is the most visited place by a visitor. Over the 3,30,000 people daily across the time square place.  \r\n', '0', '', '', '2018-12-27 19:17:05', 'Enabled', '0000-00-00 00:00:00', 'False', '0000-00-00 00:00:00'),
(143, '277', '9/11 Memorial and Museum:', 'The most horrible act which happens the World Trade Center. By that attack 3,000 people were killed on that memory the museum was known as National September 11 Memorial. It is curving glassing building two pools and its most important feature is artifacts and photos.', '', '0', '', '2018-12-29 20:06:43', 'Enabled', '0000-00-00 00:00:00', 'False', '0000-00-00 00:00:00'),
(144, '285', 'Muir Woods National Monument :', 'This Wood Monument has a wide range of 400 to 800 Years and their height up to 250 feet. There is a different category of trees like big leaf maple, Douglas Fir, and Tanoaks. This monument also includes wildlife species like deer, woodpecker, river otter, squirrels and many more.  ', '', '0', '', '2018-12-31 11:50:38', 'Enabled', '2018-12-31 17:46:08', 'False', '0000-00-00 00:00:00');
