(16, 'Reviews, Comments and other Submissions', '', 'We are always keen to know your views and appreciate hearing from you. Lowflyfares.com website also provides some terms and conditions regarding journals, recommendations, reviews, query, opinions, suggestion ideas, news articles, directories, guides, text, images, photographs, illustrations, graphics, logos, information, data, software, applications, messages, ideas, comments, testimonial, questions, or other materials received by Lowflyfares.com from you. All these terms and conditions apply on all submitting content to the website through the email, posting on website or otherwise.\r\n\r\nLowflyfares.com and its subsidiaries, corporate affiliates, co-branded or linked website partners through whom we provide our travel products and travel services, a non-exclusive, royalty-free, perpetual, transferable, irrevocable and fully sub licensable right to:\r\n\r\n	Use and create derivative works from, publicly display, perform such Submissions throughout the world in any media, here we can also, reproduce, modify, translate, distribute and publish all these.\r\n\r\n	Use the name and email Id etc. that you submit in connection with such submission.\r\n\r\n	Read the terms and conditions and agree with all that Lowflyfares.com may select to provide attribution of your opinion, comments or reviews at our discretion, and that such submissions may be shared with our supplier partners.\r\n\r\nIn any case of violation to you or the Lowflyfares.com rights in the submissions, posting by a breach of these Terms of Use, Lowflyfares.com has the right to pursue at law that person or entity. All these submissions and postings are non-proprietary and non-confidential. Lowflyfares.com takes no \r\n\r\nresponsibility and assumes no liability for any submission posted or submitted by the user. We reserve all the right in our absolute discretion to determine which comment is published on the website. If you do not agree to these Terms of Use, please do not provide us with any submission.\r\n\r\nLowflyfares.com terms, conditions and policies are provided with the respect to claims by the third parties that the content available on the website including the material related to any submission, infringes the copyright owned by said third party can be found in the Claims of Copyright Infringement section.', '0', '0', '', '2018-02-22 13:34:24', 'Enabled', '2018-03-31 16:02:33', 'False', '0000-00-00 00:00:00'),
(15, 'Suppliers Policy Rules and Restrictions', '', 'While using the website of Lowflyfares.com you may read carefully the additional terms and conditions and get familiar with. At Lowflyfares.com website there are some additional terms and conditions that also apply to your purchase of any travel related goods and services or any of your reservation. While the user elects to deal through our website he must abide by the terms and conditions of purchase imposed by Lowflyfares.com.\r\n\r\nFulfilment of any suppliers rules and the restrictions regarding the availability and use of fares, products, or services are not covered under these terms and conditions. This agreement includes but not limited to payment of all amount when due to the compliance of any suppliers rules and restrictions. Airfare is only guaranteed once the purchase has been completed and the tickets have been issued. Airline companies and other travel suppliers may change their prices without any prior notice. So at Lowflyfares.com, we reserve all the rights to cancel all your bookings and reservations, if full payment is not received in a timely fashion.\r\n\r\nTo cover your additional expenses incurred during your stay in hotel, some hotel suppliers may require you to present credit card or cash upon check-in. These types of payments are not related to any payment received by Lowflyfares.com for your booking.', '0', '0', '', '2018-02-22 13:32:50', 'Enabled', '2018-03-31 16:03:21', 'False', '0000-00-00 00:00:00'),
(13, 'Using the Services of  Lowflyfares.com', '', 'We are only responsible for the transactions done only by the websites user through Lowflyfares.com. Here at Lowflyfares.com, we are not responsible for screening, censoring or otherwise controlling transactions, including whether the transaction is legal and valid as per the laws of the land of the user.\r\n\r\nUsers of the website agree that they will abide all such additional procedure and guidelines, as it modified from time to time, in connection with the use of the services. All the users of the website have to comply with all applicable laws and regulations regarding to use of services provided. In any term, condition, and notice on the website disagreements with the additional Terms or other terms and guidelines contained within any particular our website, then these terms shall control.\r\n\r\n', '0', '0', '', '2018-02-22 13:31:39', 'Enabled', '2018-03-31 16:07:37', 'False', '0000-00-00 00:00:00'),
(14, 'Alteration & Modification of Terms of Use', '', 'As Lowflyfares.com website is a part of the Lowflyfares.com Travels Service, each and every module together with the content arrangement and compilation found on this website, are the copyrighted property of Lowflyfares.com. Here all the rights and access to change the terms, conditions and notices under which the Lowflyfares.com website is offered, including but not limited to the charges associated with the use of the website.\r\n\r\nAt Lowflyfares.com the terms and conditions are subject to regular reviewing. Lowflyfares.com has endeavored to ensure that all information, terms, conditions and notices contained herein are standard, and every effort is made to ensure that they are complete and correct. Although we at Lowflyfares.com, cannot guarantee that the description and the content on each page of the website is correct, nor make any representations regarding the accuracy, completeness regarding errors or omissions occurred due to human, any data entry errors or any loss or damage by users due to any information contained herein.\r\n\r\n', '0', '0', '', '2018-02-22 13:32:14', 'Enabled', '2018-03-31 16:06:18', 'False', '0000-00-00 00:00:00'),
(12, 'Terms & Condition of using the Website', '', 'As per the terms and conditions given for the use of the website every user must affirm the following:\r\n\r\n	Each user possesses the lawful authority to create a binding legal obligation.\r\n\r\n	He will use this website in accordance with these Terms of Use.\r\n\r\n	The certain user will only use this website to make legitimate reservations for you or for another person for whom you are legally authorized to act.\r\n\r\n	The user will inform such other persons about the Terms of Use that apply to the reservations you have made on their behalf, including all rules and restrictions applicable thereto.\r\n\r\n	All information supplied by you on this website is true, accurate, current and complete.\r\n\r\n	If you are a registered member of Bookofares.com and have a Bookofares.com account, you will safeguard your account information and will supervise and be completely responsible for any use of your account by you and anyone other than you.\r\n\r\nHere at Bookofares.com, we retain all right at our sole discretion to deny access to anyone to our website and the product and services that we offer, at any time and for any reason, including, but not limited to, for violation of these Terms of Use.', '0', '', '0', '2018-02-22 13:31:12', 'Enabled', '0000-00-00 00:00:00', 'True', '2018-03-31 16:16:11'),
(11, 'Limited Users', '', 'All the content, information on this website or the infrastructure used to provide such content and information, is proprietary to us or our suppliers and providers. Bookofares.com website is specifically meant for personal use only. The website is not for commercial use, unless otherwise specified. As per the terms and conditions or under the copyright law the websites user shall not modify copy, transmit, distribute, display, perform, reproduce, publish, create derivative works from, transfer, or sell any information, software, product or services obtained from this site. You acknowledge that you did not acquire any ownership rights by downloading copyrighted material. Additionally, you may also agree not to:\n<br/><br/>\nUse websites content or any material for any commercial purpose.\n<br/><br/>\n	Conduct any speculative, false, or fraudulent activity, booking or any reservation in anticipation of demand.\n<br/><br/>\n	Access, monitor or copy any content or information of this website using any robot, spider, scraper or other automated means or any manual process for any purpose without our written permission.\n<br/><br/>\n	Violate the restrictions in any robot exclusion headers on this website or bypass or circumvent other measures employed to prevent or limit access to this website.\n<br/><br/>\n	Take any action that imposes, or may impose, in our discretion, an unreasonable or disproportionately large load on our infrastructure.\n<br/><br/>\n	Deep-link to any portion of this website (including, without limitation, the purchase path for any travel services) for any purpose without our written permission.\n<br/><br/>\n	\"Frame\", \"mirror\" or otherwise incorporate any part of this website into any other website without our prior written authorization.\n<br/><br/>\nAs per the agreement with websites user, Bookofares.com reserves all rights to cancel your booking that is associated with the users name, email address or account if Bookofares.com find any suspicious activity or your booking or account shows any sign of fraud or abuse action. Bookofares.com may also take legal action if the user conducts any fraudulent activity, he may be liable for monetary losses to Bookofares.com, including the litigation cost and damage.', '0', '', '0', '2018-02-22 13:29:42', 'Enabled', '0000-00-00 00:00:00', 'True', '2018-03-31 16:16:03'),
(10, 'Ownership and Copywriters Policy', '', 'Bookofares.com module, together with its content arrangement and content compilation on the website are subject to copywriters property. All these are making a part of Bookofares.com services. On the website there is some Data that is related to schedule its copy write work of third party information providers.\n<br/><br/>\nAt Bookofares.com, we provide the users some content such as trademarks, logo, sound, graphics, videos or any other material or information that is displayed on the website are registered or may be protected by copyrights, trademarks, or other intellectual property rights and laws. All the users acknowledge and agree about the condition that they shall not copy, transmit, upload post, reproduce, or distribute any content or create derivative works of such material without express authorization.\n<br/><br/>\nThe use of such materials on any other website, application or in any environment of networked computers is prohibited. Thus user may use any copyrighted or other proprietary content with the consent of the owner and he must retain all copyright and trademark notices, including any other proprietary notices, contained in the available materials, and the user must not alter, obscure or obliterate any of such notices.\n<br/><br/>\nNo license or right to use any of the Trademarks without the written permission of the Bookofares.com, or such other party that may own the Trademarks, is granted or should be implied. The unauthorized use such as submission or distribution of copyrighted or other proprietary content is illegal and could subject the user to personal liability or criminal prosecution.', '0', '', '0', '2018-02-22 13:26:14', 'Enabled', '0000-00-00 00:00:00', 'True', '2018-03-31 16:15:55'),
(9, 'User agreement between customers and Bookofares.com', '', 'Welcome to Bookofares.com. This website is provided solely to assist customers in gathering travel information, determining the availability of travel related goods and services. We at Bookofares.com make legitimate travel reservations or otherwise transacting business with the travel suppliers and for no other purposes.\n\nBookofares.com website is offered to you on conditioned of your acceptance and every effort is made to ensure our websites users accept that the information, terms, conditions and notices contained on this website are complete, correct and without modification. This disclaimer policy refers to the customers visiting our website and/or booking a travel reservation via this website, or through our customer service agents.\n<br/><br/>\nBookofares.com may at any time modify this user Agreement and your continued use of the Bookofares.com service will be conditioned upon the terms and conditions in force at the time of your use. Additionally, the website of Bookofares.com may contain the terms and conditions related to govern any particular feature of a particular offer. In the event that any of the terms & conditions contained herein conflict with the additional terms or guidelines contained within Bookofares.com website, then these terms shall prevail.\n<br/><br/>\nPlease read the terms & conditions of use carefully given on the website. While accessing or using Bookofares.com website, booking any travel product or service on the website, or contacting our travel executives, you agree that the Terms & conditions of Use then in force shall apply. Our website constitutes a user agreement that is expressly conditioned on user acceptance and by using Bookofares.com Service; you signify your agreement to all such information, terms, conditions and notices. If you do not agree with any aspect of the following terms, conditions and notices, you must not use and make reservation through Bookofares.com website.\n\n', '0', '', '0', '2018-02-22 13:10:33', 'Enabled', '0000-00-00 00:00:00', 'True', '2018-03-31 16:15:47'),
(17, 'Privacy Policy', '', 'Bookofares.com always believes in protecting your privacy while you are using the website or making any booking with Bookofares.com. Review the current and updated privacy policy that also governs your use of this particular website, to understand our practices.', '0', '', '0', '2018-02-22 13:35:13', 'Enabled', '0000-00-00 00:00:00', 'True', '2018-03-31 16:00:44'),
(18, 'Prepaid Hotel Booking and Reservations', '', 'To facilitate booking or reservations for hotel accommodation with the best chance to stay during your travel, Lowflyfares.com pre-negotiates certain hotel rooms with the hotel suppliers on travelers behalf. Displayed room rates on website are the combinations of the pre-negotiations on the Users behalf and recommendation. Whenever you choose Lowflyfares.com to book your travel, you acknowledge that you authorized Lowflyfares.com to book your reservations for the total reservation price, which includes the room rate displayed on the website, plus tax recovery charges, service fees (where applicable) and taxes on the Lowflyfares.com services. Upon submitting your reservation request you authorize the Lowflyfares.com to facilitate hotel reservations on your behalf, including making payment arrangements with hotel suppliers.\r\n\r\nYou grant that except as provided below with respect to tax responsibility on the amounts we retain for our services, Lowflyfares.com doesnt not collect any taxes for remittance to applicable taxing authorities. All the tax recoveries charged on the prepaid hotel transactions are a recovery of the estimated taxes that the Lowflyfares.com pays to the hotel supplier for taxes due on the hotel\'s rental rate for the room. The hotel suppliers are solely responsible for remitting the applicable taxes to the applicable taxing jurisdictions. None of the Lowflyfares.com act as co-vendors with the supplier with whom we book or reserve our customer\'s travel arrangements.\r\n\r\nHere the displaying taxability and the appropriate tax rate may vary greatly with the selection of location in effect at the time of the actual use of the hotel by our customers. We retain service fees as additional compensation in servicing your travel booking or reservation.\r\n\r\nAt Lowflyfares.com website users may cancel or change their prepaid hotel reservations, where you will be charged the cancellation or change fee, indicated in the rules and restrictions for the hotel reservation. In the event you do not show for the first night of the reservation and plan to check-in for subsequent nights in your reservation, you must confirm the reservation changes with us no later than the date of the first night of the reservation to prevent cancellation of your reservation.', '0', '0', '', '2018-02-22 13:36:06', 'Enabled', '2018-03-31 16:00:30', 'False', '0000-00-00 00:00:00'),
(19, 'Lowflyfares.com Liability Disclaimer', '', 'We are not taking any responsibility regarding the accuracy of and disclaim all liability for any error or other type of inaccuracies which relate to the information and description of the flight, vacation, cruise, hotel, cruise, car and other travel products and travel services displayed on Lowflyfares.com Website.\r\n\r\nInformation, software, application, our product and services those are published on this website may include inaccuracies or errors. In the addition the Lowflyfares.com expressively reserves all rights to correct any pricing or any type of error on our website and/or pending bookings and reservations made under an incorrect price. In such case, if available, Lowflyfares.com will offer you the opportunity to keep your pending reservation at the correct price or well cancel your booking or reservation without any penalty.\r\n\r\nHotel and resort ratings are displayed on our website and all those ratings are intended as only general guideline where Lowflyfares.com does not take any guaranty for the accuracy of the ratings of such property.\r\n\r\nThe service providers of hotel, carriers and other travel product and services are fully independent and they do not perform as the agent or employees of the Lowflyfares.com and we are not liable for any act, errors, omissions, representations, warranties, breaches or negligence of any such supplier(s) or for any personal injury, death, property damage, or other damages or expenses resulting from there.\r\n\r\nAdditionally Lowflyfares.com holds no liability and will make no money back in the event of any delay, cancellation, overbooking, strike, force majeure or other reasons beyond their direct control, and they have no responsibility for any additional expenses, omissions, delays, re-routing or acts of any government or authority.\r\n\r\nThe terms and conditions with all limitations are for your acknowledgement regarding the allocation of risk between the parties. All these conditions and limitations are specified in this segment will survive and apply even if any limited remedy specified in these Terms of Use is found to have failed of its essential purpose. The limitations of liability provided in these Terms of Use inure to the benefit of the Lowflyfares.com and/or respective agents and suppliers.\r\n\r\nLowflyfares.com serving its customers only as a travel agent and acts only as a booking agent, there is no liability taken by the Lowflyfares.com for any aspect of preparations and arrangement between the suppliers and the customers as regarding to the standard of the services. In no circumstances shall Lowflyfares.com will be responsible for the services offered by the supplier.', '0', '0', '', '2018-02-22 13:37:40', 'Enabled', '2018-03-31 15:54:21', 'False', '0000-00-00 00:00:00'),
(20, 'Links to Third Party Sites', '', 'On Lowflyfares.com it may contain some other websites\' links of third parties. All these available links are not included under the control of Lowflyfares.com and the company is not responsible for the content, material, limitations, changes and updates or any form of transmission whatsoever, received from any linked website.\r\n\r\nWe at Lowflyfares.com provide these links to our users only for their convenience, and the inclusion of any web link does not imply endorsement by us of that particular website or any association with its operators or owners including the legal heirs or assigns thereof.\r\n\r\n', '0', '0', '', '2018-02-22 13:38:18', 'Enabled', '2018-03-31 15:49:23', 'False', '0000-00-00 00:00:00'),
(21, 'Currency Converter', '', 'Currency quotes are not updated every day. Check the date on the currency converter feature for the day that currency was last updated. The information supplied by this application is believed to be accurate, but then Lowflyfares.com and its Affiliates, and/or our respective suppliers do not guarantee such accuracy. When using this information for any financial purpose, we advise you to consult a qualified professional to verify the accuracy of the currency rates. We do not authorize the use of this information for any purpose other than your personal use and you are expressly prohibited from the resale, redistribution, and use of this information for commercial purposes.', '0', '0', '', '2018-02-22 13:38:59', 'Enabled', '2018-03-31 14:18:36', 'False', '0000-00-00 00:00:00'),
(22, 'Bank and Credit Card Fees', '', 'Some banks and credit cards impose fees for international transactions. If you are making a booking from outside of the United States on a U.S. credit card, your bank may convert the payment amount to your local currency and charge you a conversion fee. This means the amount listed on your credit or bank card statement may be in your local currency and therefore a different figure than the figure shown on the billing summary page for a reservation booked on the website. In addition, a foreign transaction fee may be assessed if the bank that issued your credit card is located outside of U.S. Booking international travel may be considered to be an international transaction by the bank or card company, since Lowflyfares.com may pass on your payment to an international travel supplier. The currency exchange rate and foreign transaction fee is determined solely by your bank on the day that they process the transaction. If you have any questions about these fees or the exchange rate applied to your booking, please contact your bank.\r\n\r\n\r\n\r\n', '0', '0', '', '2018-02-22 13:39:25', 'Enabled', '2018-03-31 14:19:42', 'False', '0000-00-00 00:00:00'),
(23, 'Copyright and Trademark Notices', '', 'All published content and the material available on the Bookofares.com website are the Bookofares.com. All rights reserved. The Bookofares.com is not responsible for the content and material on the website operated by the third parties other than the Bookofares.com are either registered trademarks or trademarks of Bookofares.com in U.S. and/or other countries. Other logos and product and company names mentioned herein may be the trademarks of their respective owners.', '0', '', '0', '2018-02-22 13:39:50', 'Enabled', '0000-00-00 00:00:00', 'True', '2018-03-31 14:16:36'),
(24, 'Counter-Notification', '', 'Lowflyfares.com respects the copyrights and the limitations of others. In any case if any user of Lowflyfares.com believes in good faith that the content published on Lowflyfares.com or the materials hosted by us infringe anyones copyright, user may send us a written notice that includes the following information. Please note that we will not process your complaint if it isn\'t properly filled out or if the complaint is incomplete:\r\n\r\n	A clear classification of the copyrighted work you claim was infringed.\r\n\r\n	Identification of related material or content that you claim is infringing the copyrighted work, and information that will allow us to locate that material on the website, such as a link to the infringing material.\r\n\r\n	Contact details preferably including an email address and telephone number, so Lowflyfares.com may reply regarding to your complaint.\r\n\r\n	The statement related to faith belief that the material that is claimed as copyright infringement is not authorized by the copyright owner, its agent, or the law.\r\n\r\n	A particular statement for that specific the information in the notification is accurate, and under penalty of perjury, the complaining party is authorized to act on behalf of the owner of an exclusive right that is allegedly infringed.\r\n\r\n	The signed notice by the person authorized to act on behalf of the owner of an exclusive right that is allegedly infringed.\r\n\r\n\r\n\r\n', '0', '0', '', '2018-02-22 13:41:56', 'Enabled', '2018-03-31 14:16:15', 'False', '0000-00-00 00:00:00');
