(192, '1', 'About Faresquest', '', 'Fare Bubble, a leading online travel booking company, provides a wide range of services including domestic and international flight booking.  That means whether you are looking for domestic flight booking or want to book an international flight, you can get everything at our one-stop solution.  We have been in this industry for the past 20 years and millions of customers have used one or more of our travel-related services. You no more have to depend on middlemen or travel agents for the booking of your flight tickets.<p><br></p><p><b>Why Trust Fare Bubble</b></p><p></p><p>If you are thinking that why should you choose the Fare Bubble. The answer is the best deal. We provide our customers with the best deals in flight booking as we keep only a very marginal commission with us. Customer satisfaction is our first priority instead of making profits. Booking with Fare Bubble is easy that even a beginner can do it without a glitch. In case you get stuck somewhere, then you can contact our 24/7 open helpline and we would be happy to help. The best part of booking flight tickets with us is you can compare prices and grab the best deal. If you have to cancel your booking due to some reasons, then the booking amount is refunded to your source account instantly, making sure that you dont face any delay in getting your booking amount back. But, you have to get your flight ticket canceled at least 4 to 6 hours before the time of departure of the flight. We have also tied up with many banking partners to reduce your flight booking price.For any kind of queries, questions and concerns related to online flight ticket bookings, our professional and experienced team of customer support is available 24/7 for your help and support. You can Book Online or Call Us 24/7 at 1-844-860-8582.</p><p></p>', '0', '0', '', '2018-12-26 17:34:56', 'Enabled', '2019-05-25 15:25:23', 'False', '0000-00-00 00:00:00'),
