(270, '3', '1', 'Domestic', 'Flight-to-Dallas-Fort-Worth', 'Dallas Fort Worth', 'Flight To Dallas Fort Worth', 'Dallas is the famous city in the United States of Texas. Dallas is the largest inland metropolitan city in the United States. Dallas is the most pronounced architecture in the city from the state-of-the-art and postmodern era. There is several small structure Gothic Revival style like Kirby Building and the grandeur style like Davis and Wilson building.', 'Cheap flight to Dallas Fort Worth', 'faresquest', 'index , follow', 'website ', 'Book Cheap Flight Dallas Fort Worth-faresquest', 'Find cheap plane tickets to Dallas Fort Worth by comparing prices for your preferred travel dates. Avail of the latest offers and get great deals', 'https://faresquest.com/domestic/Flight-to-Dallas-Fort-Worth', '', 'Nearest Airport to Dallas:', '1 .  Dallas Fort  Worth Airport <br>\r\n2 .  Dallas Love Field Airport    <br>\r\n3 .  Austin-Bergstrom International Airport <br>\r\n4 .  	Waco International Airport', '0', '0', '', '2018-11-05 19:14:15', 'Enabled', '2018-12-31 17:24:54', 'False', '0000-00-00 00:00:00'),
(271, '4', '1', '', 'United-Airlines', 'United  Airlines', 'United Airlines', 'United Airlines commonly meaning is to United. The major United States airline headquartered in Chicago, Illinois. It is a world third largest and oldest airline which is measured by revenue. It carrier founded by 1926. It flies more than 300 destination and 60 countries spanning domestic and international route to Asia- Pacific region (North America, South America, Europe, Aisa and oceanic). There are seven major hubs Chicago OHare (ORD), Denver International (DEN), Guam (GUM), Houston George Bush Intercontinental (IAH), Los Angeles International (LAX), Newark Liberty International (EWR), San Francisco International (SPO). United Airlines founding member of the Star Alliance.', 'United airlines offers, United airlines flight United, United airline flight tickets', 'faresquest', 'index , follow', 'website ', 'United Airlines Flight Tickets-faresquest', 'Avail of the best and latest offers on United Airlines flight tickets across destinations in the USA right here', 'https://faresquest.com/airlines/United-Airlines', 'seo_og_image/123goa.jpg', 'Way Around United Airlines baggage fee', 'The maximum dimension for carrying bags are 9 inches x 14 inches x 22 inches ( 22cm x 35cm x 56cm) including handle and wheels.\r\nMaximum dimension for personal items such as shoulder bags, laptop bag or other small items 9 inches x 10 inches x 17 inches (22cm x 25cm x 43cm)\r\n<br/>\r\n<span>In a United airline, there are different Premier level membership.<span><br>\r\n1 . Premier silver 1 Bag <br/>\r\n2 . Premier Gold 2 Bags <br/>\r\n3 . Premier Platinum 3 Bags', '0', '0', '', '2018-11-06 12:11:52', 'Enabled', '2018-12-31 16:36:44', 'False', '0000-00-00 00:00:00'),
(272, '3', '2', 'Domestic', 'Flight-to-Denver', 'Denver', 'Flight To Denver', 'Denver is also known as one of the famous city of America. It is alive and plays city and a great time to spend there. With the rocking mountains, Denver is a visually appealing country town, filled with a variety of sights and attractions for everyone, from families to couples. If you are wandering the Denver Art Museum, doing some shopping and visiting animals at the Denver Zoo, day or night, there is no shortage of things to do. Denver is home of a line-up of a museum, the museum place is nationally recognized like Denver Art Museum, second largest museum id Denver Performing Arts Center, this place is filled by the art gallery, bars, club, and restaurants. The city also homes to several parks, including Civic Center Park in the heart of downtown, Washington Park, Cheesman Park, and City Park. The Denver\'s most famous park: Red Rocks Park & Amphitheater, which is one of the top outdoor presentation venues in the United State', 'Cheap flight to Denver', 'faresquest', 'index , follow', 'website ', 'Book Cheap Flight Denver-faresquest', 'Find cheap plane tickets to Denver by comparing prices for your preferred travel dates. Avail of the latest offers and get great deals', 'https://faresquest.com/domestic/Flight-to-Denver', '', 'Nearest airport to Denver:', '1 .	Denver international airport<br>\r\n2 .	Colorado Spring Airport<br>\r\n3 .	Cheyenne Regional Airport<br>\r\n', '0', '0', '', '2018-12-19 11:28:59', 'Enabled', '2018-12-31 17:32:12', 'False', '0000-00-00 00:00:00'),
