(940, '290', 'SeaWorld:', 'Orlandos SeaWorld is known enormous aquariums, whale and dolphin shows, exciting rides and touch pools. The interaction with dolphin pool and pets these are intelligent creatures as well as beautiful. There is some other space also for manatee rehabilitation center of dolphin nursery where the youngest dolphins get cared. In this park, there are some thrill rides like the Manta Coaster, the Makohypercoaster, and the Kraken Virtual Reality Coaster.&nbsp;', '', '0', '', '2019-01-02 18:19:59', 'Enabled', '0000-00-00 00:00:00', 'False', '0000-00-00 00:00:00'),
(941, '289', 'Art Deco District:', 'This specific neighborhood in Miami seaside would remind you of the earlier times of Florida with its superbly restored Art Deco buildings. Your nightlife within the town would be made thrilling with the colorful neon signs and outdoor dining regions. lots of these eating areas overlook the seaside and the ocean, growing the right mood for a memorable eating experience.', '', '0', '', '2019-01-02 18:31:47', 'Enabled', '0000-00-00 00:00:00', 'False', '0000-00-00 00:00:00'),
(942, '289', 'Miami Beach', 'South beach occupies one of the great, highly sought-after, seaside front locations on the planet between the Atlantic Ocean and Biscayne Bay. thanks to its outstanding nightlife, superior motels, and accommodations, art galleries, extremely good, bars, restaurants &amp; boutique purchasing, it is a famous enjoyment vacation spot for locals, national &amp; international tourists. This huge section of seaside fronts the ocean inside the neighborhood of the same name. often packed in the summer season, this is the most famous seaside in Miami and one of the top seashores in Florida.', '', '0', '', '2019-01-02 18:31:47', 'Enabled', '0000-00-00 00:00:00', 'False', '0000-00-00 00:00:00'),
(943, '291', 'Carthage:', 'Carthage is a seafaring Phoenicians memorialized the Punic Wars. This is an ancient town now besides the sea among the suburbs of outlying district of Tunis.', '', '0', '', '2019-01-03 12:03:45', 'Enabled', '0000-00-00 00:00:00', 'False', '0000-00-00 00:00:00'),
(944, '291', 'The National Bardo Museum:', 'This museum has a beautiful mosaics display inside the Bardo. In North America, this museum is very famous and it has a world huge collection of mosaics. If you may visit Tunisia then this place should be top on the list to do.', '', '0', '', '2019-01-03 12:03:45', 'Enabled', '0000-00-00 00:00:00', 'False', '0000-00-00 00:00:00'),
(945, '291', 'SidiBou Said:', 'SidiBou Said is impressive and amazing photogenic, the whitewashed alleyway, colorful blue doors, and wrought window frames, this is known for finest architecture.', '', '0', '', '2019-01-03 12:03:45', 'Enabled', '0000-00-00 00:00:00', 'False', '0000-00-00 00:00:00'),
(946, '291', 'Kairouan:', 'This is the most important part of the city for those of Muslim Faith. The work of architecture in Arabic is truly stimulated and the skyline is skinny minarets and the bulky domes. Kairouan is the old town has a charming, the atmosphere is truly mesmerizing and it highlights the place.', '', '0', '', '2019-01-03 12:03:45', 'Enabled', '0000-00-00 00:00:00', 'False', '0000-00-00 00:00:00'),
(947, '287', 'Kemah Boardwalk:', 'The boardwalk is built at the shore of Galveston Bay and Clear Lake. This home is more than 10 restaurant, a collection of rides, attractions, midway games, a boutique hotel, 400 slip, and multiple shops. There no charge for the walk around on the boardwalk.', '', '0', '', '2019-01-03 13:18:17', 'Enabled', '0000-00-00 00:00:00', 'False', '0000-00-00 00:00:00');
INSERT INTO `tb_page_content` (`id`, `page_id`, `paratitle`, `paracontent`, `add_by`, `update_by`, `delete_by`, `add_date`, `status`, `update_date`, `delete_status`, `delete_date`) VALUES
(948, '287', 'Museum Of Fine Art:', 'The Museum of Fine Art had a collection of 62,000 work of art. It has a most diverse and largest collection from the southwest United States. Most of the area is occupied by the Italian Renaissance painting, French Impression, America and European decorative art, photography, American Sculpture. There is also modern as well as contemporary Latin American art, Islamic art, and Asian art strengthen the museum abundance of variety.', '', '0', '', '2019-01-03 13:18:17', 'Enabled', '0000-00-00 00:00:00', 'False', '0000-00-00 00:00:00'),
(949, '287', 'Toyota Center:', 'It is indoor arena located downtown Houston. The Coliseum home of the Houston Rockets of the National Basket Association. This place also hosts events and concert are held over there.', '', '0', '', '2019-01-03 13:18:17', 'Enabled', '0000-00-00 00:00:00', 'False', '0000-00-00 00:00:00'),
(950, '287', 'Children Museum of Houston:', 'This museum is full of art, colors, fun and full of enthusiasm. This place has a display of health, science, and technology, history and culture this museum has an abundance of opportunities for a youngster to explore their ideas.', '', '0', '', '2019-01-03 13:18:17', 'Enabled', '0000-00-00 00:00:00', 'False', '0000-00-00 00:00:00');
